import React, { useState } from 'react';

function Compteur() {
  const [compte, setCompte] = useState(0);

  return (
    <div>
      <h1>{compte}</h1>
      <button onClick={() => setCompte(compte + 1)}>Augmenter</button>
      <button onClick={() => setCompte(compte - 1)}>Diminuer</button>
    </div>
  );
}

export default Compteur;
